import React from "react";

import '../stylesheet/componentes/titles.css'

function Titles({ titulo, cont }) {
    return (
        <div className="container-titles">
            <h3>{titulo}</h3>
            <button onClick={cont}></button>
        </div>

    )
}

export default Titles
